import React from 'react';
import NavBar from './Nav';
import CarCard from './CarCard';
import MotorBikeCard from './MotorBikeCard';
import Container from 'react-bootstrap/Container';

class Vehicles extends React.Component{
    constructor(props){
        super(props);
        this.state={
          vehicles:[]
        }
      }
      componentDidMount(){
        fetch('http://localhost:8081/api/get')
        .then(res=>res.json())
        .then((data)=>{
            this.setState({vehicles : data})
            console.log(data)
        }).catch(console.log) 
    }
      render(){ 
        return(
          <Container>
                <VehicleItem vehicles={this.state.vehicles}/>
          </Container>
     
        );
      
      }

}
const components = {
  Car : CarCard,
  MotorBike : MotorBikeCard
};
const VehicleItem = ({vehicles})=>{
    return(
        <Container>
            <h1><center>VEHICLE LIST</center></h1>
            {vehicles.map((item)=>{
             const type = (item.vehicle_TYPE==='Car'?'CarCard' : 'MotorBikeCard');
             console.log(type)
            
             const cardTypeComponent = components[item.vehicle_TYPE];
            return(
            <cardTypeComponent data={item}/>
            );
        })}
        </Container>
    );

}
export default  Vehicles;
